import React from 'react'
import "./Footer.css";
import logo from "/My project/ca/src/Assets/ca-logo.png";

function Footer() {
    return (
        <div className="footer">
            <div className="footer__container">
                <div className="footer__left"></div>
                <img src={logo} alt="" className="footer__logo"></img>
                <p>Charles & Darwish Associates Accounting and Bookkeeping Services LLC is a central hub for all the Management Consultant Services you need in Dubai. From Advisory Services to Tax Auditing, we offer a wide variety of services to an inclusive clientele.</p>
                


            </div>
        </div>
    )
}

export default Footer
